@interface LCSSamllVideoWatchVideoVC ()<UIAlertViewDelegate,LCDDrawVideoViewControllerDelegate>

@property (nonatomic, strong) LCDDrawVideoViewController *hostDrawViewController;
@property (nonatomic, strong) LCDDrawVideoViewController *userDrawViewController;
@property (nonatomic, strong) UIAlertView *seekAlertView;
@property (nonatomic, strong) UIAlertView *setDataAlertView;


@end

@implementation LCSSamllVideoWatchVideoVC

- (void)buildCells {
    lcs_weakify(self)
    LCSActionModel *host_mode = [LCSActionModel plainTitleActionModel:@"一起看视频（主控端）" cellType:LCSCellType_video action:^{
        lcs_strongify(self)
        LCDDrawVideoViewController *vc = [[LCDDrawVideoViewController alloc] initWithConfigBuilder:^(LCDDrawVideoVCConfig * _Nonnull config) {
            config.watchVideoTogetherGroupID = 7042536157757833252;
            config.currentMode = LCDDrawVideoWatcherRole_Host;
            config.delegate = self; //主控端可以通过这里的时机逻辑去控制被控端
        }];
        vc.modalPresentationStyle = UIModalPresentationOverFullScreen;
        [self.navigationController presentViewController:vc animated:YES completion:nil];
        [self __buildCloseBtnWith:vc];
        self.hostDrawViewController = vc;
    }];
    
    LCSActionModel *user_mode = [LCSActionModel plainTitleActionModel:@"一起看视频（被控端）" cellType:LCSCellType_video action:^{
        lcs_strongify(self)
        LCDDrawVideoViewController *vc = [[LCDDrawVideoViewController alloc] initWithConfigBuilder:^(LCDDrawVideoVCConfig * _Nonnull config) {
            config.currentMode = LCDDrawVideoWatcherRole_User;
        }];
        vc.modalPresentationStyle = UIModalPresentationOverFullScreen;
        [self.navigationController presentViewController:vc animated:YES completion:nil];
        [self __buildCloseBtnWith:vc];
        [self __buildUserPageActionsWith:vc];
        self.userDrawViewController = vc;
        
        [self.userDrawViewController syncDataToPlay:[self testEncryptStr] refreshType:1 withCompletion:^(bool isSuccess, NSString * _Nonnull msg) {

        }];
        
    }];
    self.items = @[
        @[host_mode],
        @[user_mode]
    ];
}

- (void)__buildCloseBtnWith:(UIViewController *)vc {
    CGFloat kFrontPadding = 20;
    CGFloat kTopPadding = 40;
    CGFloat kCloseBtnWidth = 80;
    CGFloat kCloseBtnHeight = 30;
    
    UIButton *btn = [[UIButton alloc] initWithFrame:CGRectMake([[UIScreen mainScreen] bounds].size.width - kFrontPadding - kCloseBtnWidth , kTopPadding, kCloseBtnWidth, kCloseBtnHeight)];
    [btn setTitle:@"返回" forState:UIControlStateNormal];
    [btn setBackgroundColor:UIColor.grayColor];
    [btn addTarget:self action:@selector(__getbackFromWatchVideoTogether) forControlEvents:UIControlEventTouchUpInside];
    [vc.view addSubview:btn];
}


- (void)__buildUserPageActionsWith:(UIViewController *)vc {
    CGFloat kFrontPadding = 20;
    CGFloat kBtnWidth = 80;
    CGFloat kBtnHeight = 30;
    
    CGFloat kkFrontPadding = [[UIScreen mainScreen] bounds].size.width - kFrontPadding - kBtnWidth;
    
    UIButton *nextBtn = [[UIButton alloc] initWithFrame:CGRectMake(kkFrontPadding, kFrontPadding + 40 + 10 + 10 , kBtnWidth, kBtnHeight)];
    [nextBtn setTitle:@"下一个" forState:UIControlStateNormal];
    [nextBtn setBackgroundColor:UIColor.grayColor];
    [nextBtn addTarget:self action:@selector(__nextMovie) forControlEvents:UIControlEventTouchUpInside];
    [vc.view addSubview:nextBtn];
    
    UIButton *previousBtn = [[UIButton alloc] initWithFrame:CGRectMake(kkFrontPadding, CGRectGetMaxY(nextBtn.frame) + 10, kBtnWidth, kBtnHeight)];
    [previousBtn setTitle:@"上一个" forState:UIControlStateNormal];
    [previousBtn setBackgroundColor:UIColor.grayColor];
    [previousBtn addTarget:self action:@selector(__previewousMovie) forControlEvents:UIControlEventTouchUpInside];
    [vc.view addSubview:previousBtn];
    
    UIButton *pauseBtn = [[UIButton alloc] initWithFrame:CGRectMake(kkFrontPadding, CGRectGetMaxY(previousBtn.frame) + 10, kBtnWidth, kBtnHeight)];
    [pauseBtn setTitle:@"暂停" forState:UIControlStateNormal];
    [pauseBtn setBackgroundColor:UIColor.grayColor];
    [pauseBtn addTarget:self action:@selector(__pause) forControlEvents:UIControlEventTouchUpInside];
    [vc.view addSubview:pauseBtn];
    
    UIButton *playBtn = [[UIButton alloc] initWithFrame:CGRectMake(kkFrontPadding, CGRectGetMaxY(pauseBtn.frame) + 10, kBtnWidth, kBtnHeight)];
    [playBtn setTitle:@"播放" forState:UIControlStateNormal];
    [playBtn setBackgroundColor:UIColor.grayColor];
    [playBtn addTarget:self action:@selector(__play) forControlEvents:UIControlEventTouchUpInside];
    [vc.view addSubview:playBtn];

    UIButton *seekBtn = [[UIButton alloc] initWithFrame:CGRectMake(kkFrontPadding, CGRectGetMaxY(playBtn.frame) + 10, kBtnWidth, kBtnHeight)];
    [seekBtn setTitle:@"定位" forState:UIControlStateNormal];
    [seekBtn setBackgroundColor:UIColor.grayColor];
    [seekBtn addTarget:self action:@selector(__seek) forControlEvents:UIControlEventTouchUpInside];
    [vc.view addSubview:seekBtn];
    
    UIButton *setDataBtn = [[UIButton alloc] initWithFrame:CGRectMake(kkFrontPadding, CGRectGetMaxY(seekBtn.frame) + 10, kBtnWidth, kBtnHeight)];
    [setDataBtn setTitle:@"设置数据" forState:UIControlStateNormal];
    [setDataBtn setBackgroundColor:UIColor.grayColor];
    [setDataBtn addTarget:self action:@selector(__setUserData) forControlEvents:UIControlEventTouchUpInside];
    [vc.view addSubview:setDataBtn];
}


- (void)__setUserData {
    self.setDataAlertView = [[UIAlertView alloc] initWithTitle:@"title" message:@"输入传输数据" delegate:self cancelButtonTitle:@"Canel" otherButtonTitles:@"Confirm", nil];
    [self.setDataAlertView setAlertViewStyle:UIAlertViewStylePlainTextInput];
    [self.setDataAlertView show];
    [[self.setDataAlertView textFieldAtIndex:0] resignFirstResponder];
}

- (void)__nextMovie {
    NSInteger nextIndex = [self.userDrawViewController currentIndexVideoList] + 1;
    [self.userDrawViewController scrollToIndex:nextIndex];
}

- (void)__previewousMovie {
    NSInteger previewousIndex = [self.userDrawViewController currentIndexVideoList] - 1;
    [self.userDrawViewController scrollToIndex:previewousIndex];
}

- (void)__pause {
    [self.userDrawViewController pauseCurrentVideo];
}

- (void)__play {
    [self.userDrawViewController playCurrentVideo];
}

- (void)__seek {
    self.seekAlertView = [[UIAlertView alloc] initWithTitle:@"title" message:@"输入时间戳数字单位 毫秒" delegate:self cancelButtonTitle:@"Canel" otherButtonTitles:@"Confirm", nil];
    [self.seekAlertView setAlertViewStyle:UIAlertViewStylePlainTextInput];
    [self.seekAlertView show];
    [[self.seekAlertView textFieldAtIndex:0] resignFirstResponder];
}

- (void)__getbackFromWatchVideoTogether {
    [self.navigationController dismissViewControllerAnimated:YES completion:nil];
}

