#pragma mark - alertView Delegate
- (void)alertView:(UIAlertView *)alertView clickedButtonAtIndex:(NSInteger)buttonIndex {
    if (alertView == self.seekAlertView) {
        if (buttonIndex == 1) {
            UITextField *textField = [alertView textFieldAtIndex:0];
            NSLog(@"===%@",textField.text);
            float mSeconds = [NSString stringWithFormat:@"%@",textField.text].floatValue;
            [self.userDrawViewController seekVideoToMSeconds:mSeconds];
        }
    } else if (alertView == self.setDataAlertView) {
        if (buttonIndex == 1) {
            UITextField *textField = [alertView textFieldAtIndex:0];
            if (textField.text.length < 0) {
                return;
            }
            LCS_Log(@"【syncdata 】data : %@", textField.text);
            [self.userDrawViewController syncDataToPlay:textField.text refreshType:1 withCompletion:^(bool isSuccess, NSString * _Nonnull msg) {
                
            }];
        }
    }
}

- (NSString *)testStr {
    return [NSString stringWithFormat:@"%@",[[NSUserDefaults standardUserDefaults] objectForKey:@"only_test_watch_video_together"]];
}

- (NSString *)testEncryptStr {
    return @"";
}


@end

